DROP TABLE IF EXISTS `powersupply`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `powersupply` (
  `PowerSupplyId` int(11) NOT NULL AUTO_INCREMENT,
  `PCid` int(11) DEFAULT '1',
  `Barcode` varchar(50) DEFAULT NULL,
  `ModelName` varchar(50) DEFAULT NULL,
  `SerialNumber` varchar(50) DEFAULT NULL,
  `Power` varchar(50) DEFAULT NULL,
  `DateAdded` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `MISDate` datetime DEFAULT NULL,
  `WarrantyDate` date DEFAULT NULL,
  `Notes` text,
  `Req` varchar(200) DEFAULT NULL,
  `IsDeleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 = False (Note Deleted)\n1 = True (Deleted)',
  `Log` text COMMENT 'Keep track of changes made to a table element.',
  `PC_Id` varchar(45) DEFAULT NULL,
  `Department` enum('SQA - Broadcast & Multimedia','Engineering - Broadcast & Multimedia','Automation - Broadcast & Multimedia','HQA - Broadcast & Multimedia') NOT NULL DEFAULT 'SQA - Broadcast & Multimedia',
  PRIMARY KEY (`PowerSupplyId`),
  UNIQUE KEY `PSid_UNIQUE` (`PowerSupplyId`),
  KEY `PS-PCid_idx` (`PCid`),
  CONSTRAINT `PS-PCid` FOREIGN KEY (`PCid`) REFERENCES `computer` (`PCid`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=58 DEFAULT CHARSET=utf8;
